import React, { useState } from "react";
import PropTypes from "prop-types";

export default function Navbar(props) {
  const [textColor,setTextColor] = useState("text-body-emphasis");
  const [radTxt, setRadTxt] = useState("LIGHT");
  if (props.mode === "light") {
    setTextColor("text-body-emphasis");
    setRadTxt("LIGHT");
  } else {
    setTextColor("text-white");
    setRadTxt("DARK");
  }
  return (
    <div>
      <nav className={`navbar navbar-expand-lg bg-${props.mode}`}>
        <div className="container-fluid">
          <a className={`navbar-brand ${textColor}`} href="/">
            {props.title}
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a
                  className={`nav-link active ${textColor}`}
                  aria-current="page"
                  href="/"
                >
                  Home
                </a>
              </li>
              <li className="nav-item">
                <a className={`nav-link ${textColor}`} href="/">
                  {props.about}
                </a>
              </li>
            </ul>
            <div class="form-check form-switch">
              <input
                class="form-check-input"
                type="checkbox"
                role="switch"
                id="flexSwitchCheckDefault"
              />
              <label
                class={`form-check-label ${textColor}`}
                for="flexSwitchCheckDefault"
              >
                Enable {radTxt} MODE
              </label>
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
}
Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  about: PropTypes.string,
};
Navbar.defaultProps = {
  title: "Set title here",
  about: "Set about text here",
};
